import React from "react";
import "./stars.scss";
import Typed from "react-typed";

class Intro extends React.Component {
  render() {
    return (
      // <div id="home" className="intro route bg-image " style={{backgroundImage: "url("+bigImage+")"}}>
      <div id="home" className="intro route bg-image background">
        <div id="stars" />
        <div id="stars2" />
        <div id="stars3" />

        <div className="intro-content display-table">
          <div className="table-cell">
            <div className="container">
              <h1 className="intro-title mb-4">GG NO RE, Don't buy anymore candles, candles are dumb and bad.</h1>
              <iframe src="https://youtu.be/q8VBY1AY9FA"></iframe>
              <p> Read <a href="https://drive.google.com/file/d/1JQnw8imc1FWHF7pQxvVoNuNJttx-q0q0/view?usp=sharing">this</a> article on why you shouldn't buy candles </p>
              <p className="intro-subtitle">
                <span className="text-slider-items"></span>
                <strong className="text-slider">
                  <Typed
                    strings={[
                      "We're too hot to candle.",
		      "Candles of the future.",
		      "For the people, by candles.",
                      "Looking for a match?",
                      "We have the best candles in the world.",
	              "Getting lit, one candle at at time."
                    ]}
                    typeSpeed={80}
                    backDelay={1100}
                    backSpeed={30}
                    loop
                  />
                </strong>
              </p>
              <p className="pt-3">
                <a
                  className="btn btn-primary btn js-scroll px-4"
                  href="#about"
                  role="button"
                >
                  Read More
                </a>
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Intro;
